import React from "react";
import './Politics.css'
import Flag from "./Flag/Flag";
import Leader from "./Leader/Leader";
import Population from "./PopulationPie/Population";
import Commander from "./Commander/Commander";
import Commanders from "./Commander/Commanders";
class Politics extends React.Component{
    constructor(props) {
        super();

        this.props = props;

    }

    render() {

        return (
            <div className="politics">
                <table>
                    <td>
                        <tt>
                            <Flag src={this.props.store.flag}/>
                        </tt>
                        <tt>
                            <Leader name={"Тихон"} src={"images/leaders/caiser.png"}/>
                        </tt>
                        <tt>
                            <Population partyPopulationData={this.props.store.generateIdeologuesData.bind(this.props.store)}/>
                        </tt>
                        <tt>
                            <Commanders commanders={["hhh"]}/>
                        </tt>
                    </td>

                </table>
            </div>
        );
    }
}
export default Politics;
